import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import { Provider } from "react-redux";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";
import { SnackbarProvider } from "notistack";

// Redux Store
import store from "./redux/store";

// Layouts
import StudentLayout from "./layouts/StudentLayout";

// Auth Pages
import LoginPage from "./pages/auth/LoginPage";
import RegisterPage from "./pages/auth/RegisterPage";
import ForgotPasswordPage from "./pages/auth/ForgotPasswordPage";
import ResetPasswordPage from "./pages/auth/ResetPasswordPage";

// Student Pages
import StudentHomePage from "./pages/student/HomePage";
import StudentClassesPage from "./pages/student/ClassesPage";
import StudentAttendancePage from "./pages/student/AttendancePage";
import RegisterFacePage from "./pages/face/RegisterFacePage";

// Admin Pages (import khi cần)
// import AdminDashboard from "./pages/admin/DashboardPage";

// Teacher Pages (import khi cần)
// import TeacherDashboard from "./pages/teacher/DashboardPage";

// Guards
import PrivateRoute from "./components/auth/PrivateRoute";
import PublicRoute from "./components/auth/PublicRoute";

// Create Theme
const theme = createTheme({
  palette: {
    primary: {
      main: "#1976d2",
    },
    secondary: {
      main: "#f50057",
    },
    background: {
      default: "#f5f5f5",
    },
  },
  typography: {
    fontFamily: ['"Roboto"', '"Helvetica"', "Arial", "sans-serif"].join(","),
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          textTransform: "none",
          borderRadius: 8,
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          borderRadius: 12,
          boxShadow: "0 4px 20px 0 rgba(0,0,0,0.05)",
        },
      },
    },
  },
});

function App() {
  return (
    <Provider store={store}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <SnackbarProvider
          maxSnack={3}
          anchorOrigin={{ vertical: "top", horizontal: "right" }}
          autoHideDuration={4000}
        >
          <Router>
            <Routes>
              {/* Public Routes */}
              <Route element={<PublicRoute />}>
                <Route path="/login" element={<LoginPage />} />
                <Route path="/register" element={<RegisterPage />} />
                <Route
                  path="/forgot-password"
                  element={<ForgotPasswordPage />}
                />
                <Route
                  path="/reset-password/:token"
                  element={<ResetPasswordPage />}
                />
              </Route>

              {/* Student Routes */}
              <Route element={<PrivateRoute allowedRoles={["student"]} />}>
                <Route path="/student" element={<StudentLayout />}>
                  <Route index element={<StudentHomePage />} />
                  <Route path="classes" element={<StudentClassesPage />} />
                  <Route
                    path="attendance/:classId"
                    element={<StudentAttendancePage />}
                  />
                  {/* Thêm các route sinh viên khác khi cần */}
                </Route>

                <Route path="/register-face" element={<RegisterFacePage />} />
              </Route>

              {/* Admin Routes */}
              <Route element={<PrivateRoute allowedRoles={["admin"]} />}>
                <Route
                  path="/admin/*"
                  element={<Navigate to="/admin" replace />}
                />
                {/* <Route path="/admin" element={<AdminLayout />}>
                  <Route index element={<AdminDashboard />} />
                  ...các route admin khác
                </Route> */}
              </Route>

              {/* Teacher Routes */}
              <Route element={<PrivateRoute allowedRoles={["teacher"]} />}>
                <Route
                  path="/teacher/*"
                  element={<Navigate to="/teacher" replace />}
                />
                {/* <Route path="/teacher" element={<TeacherLayout />}>
                  <Route index element={<TeacherDashboard />} />
                  ...các route giáo viên khác
                </Route> */}
              </Route>

              {/* Default Route */}
              <Route path="/" element={<Navigate to="/login" replace />} />
              <Route path="*" element={<Navigate to="/login" replace />} />
            </Routes>
          </Router>
        </SnackbarProvider>
      </ThemeProvider>
    </Provider>
  );
}

export default App;
